import styled from 'styled-components';

const MenuLinkStyles = styled.div`
  padding: 0 2rem 0 2rem;

  a {
    text-decoration: none;
  }
  p {
    color: white;
    text-transform: uppercase;
  }
`;

export { MenuLinkStyles };
